package Challenges.Introduction;

public class Swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=20,b=32;
		int temp;
		System.out.println("before swapping--,a="+a+"b="+b);
		temp=a;
		a=b;
		b=temp;
		System.out.println("after swapping--,a="+a+"b="+b);
	}

}
